  }
  padding: 20
  "data": [
    {
      "name": "service-status",
      url: {
        index: service-status
        body: {
          size: 100
          query: {
            "match_all": {}          
          }
        }
      }
      "format": {"property": "hits.hits"},
      "transform": [
        {
          "type": "formula",
          "as": "name",
          "expr": "datum._source.service.name"
        },
        {
          "type": "formula",
          "as": "total_errors",
          "expr": "datum._source.total_errors"
        },
        {
          "type": "formula",
          "as": "total_tx",
          "expr": "datum._source.total_tx"
        },
        {
          "type": "project",
          "fields": [
            "name",
            "total_errors",
            "total_tx"
          ],
          "as": ["name", "total_errors", "total_tx"]
        }
      ]
      },
    {
      "name": "service_1",
      url: {
        %context%: true
        %timefield%: @timestamp
        index: traces-apm*,apm-*
        body: {
          size: 0,
          "aggs": {
    "service": {
      "terms": {
        "field": "service.name",
        "order": {
          "_count": "desc"
        },
        "size": 20
      }
    }
  }
        }
      }
      "format": {"property": "aggregations.service.buckets"},
      "transform": [
        {
          "type": "formula",
          "as": "name",
          "expr": "datum.key"
        }
      ]
    },
    {
      "name": "service_2",
      url: {
        %context%: true
        %timefield%: @timestamp
        index: traces-apm*,apm-*
        body: {
          size: 0,
          "aggs": {
    "service": {
      "terms": {
        "field": "span.destination.service.name",
        "order": {
          "_count": "desc"
        },
        "size": 20
      }
    }
  }
        }
      }
      "format": {"property": "aggregations.service.buckets"},
      "transform": [
        {
          "type": "formula",
          "as": "name",
          "expr": "datum.key"
        }
      ]
    },
    {
      "name": "service_3",
      url: {
        %context%: true
        %timefield%: @timestamp
        index: traces-apm*,apm-*
        body: {
          size: 0,
          "aggs": {
    "service": {
      "terms": {
        "field": "cloud.origin.service.name",
        "order": {
          "_count": "desc"
        },
        "size": 20
      }
    }
  }
        }
      }
      "format": {"property": "aggregations.service.buckets"},
      "transform": [
        {
          "type": "formula",
          "as": "name",
          "expr": "datum.key"
        }
      ]
    },
    {
      "name": "status",
      "source": ["service_1", "service_2", "service_3"]
    },
    {
      "name": "resources",
      url: {
        index: services
        body: {
          size: 100
          query: {
            "bool": {
      "must": [],
      "filter": [
        {
          "bool": {
            "should": [
              {
                "match_phrase": {
                  "process": "apm services"
                }
              }
            ],
            "minimum_should_match": 1
          }
        }
      ],
      "should": [],
      "must_not": []
    }
          }
        }
      }
      "format": {"property": "hits.hits"},
      "transform": [
        {
          "type": "formula",
          "as": "name",
          "expr": "datum._source.service.name"
        },
        {
          "type": "formula",
          "as": "type",
          "expr": "datum._source.type"
        },
        {
          "type": "formula",
          "as": "connected_to",
          "expr": "datum._source.connected_to"
        },
        {
          "type": "formula",
          "as": "connected_via",
          "expr": "datum._source.connected_via"
        },
        {
          "type": "formula",
          "as": "size",
          "expr": "1"
        },
        {
          "type": "formula",
          "as": "level",
          "expr": "datum._source.level"
        },
        {
          "type": "project",
          "fields": [
            "name",
            "type",
            "connected_to",
            "connected_via",
            "size",
            "level"
          ],
          "as": ["name", "type", "connected_to", "connected_via","size","level"]
        }
      ]
      },
      {
        name: nodes
        source: resources
        transform: [
        {
            "type": "aggregate",
            "groupby": ["type", "name"],
            "fields": ["size"],
            "as": ["size"]
          },
          {type: "formula", expr: "1", as: "size"},
          {
            type: stack
            groupby: ["type"]
            sort: {field: "name", order: "descending"}
            field: size
            offset: center
          },
          {type: "formula", expr: "(datum.y0)+0.5", as: "y0"},
          {type: "formula", expr: "(datum.y0+datum.y1)/2", as: "yc"},
           {
            type: lookup
            from: status
            key: name
            fields: ["name"]
            as: ["status"]
          },
          {
            type: lookup
            from: service-status
            key: name
            fields: ["name"]
            as: ["metrics"]
          },
          {type: "formula", expr: "(datum.status == null ? 0 : datum.status.doc_count)", as: "status"}
          {type: "formula", expr: "(datum.metrics == null ? 0 : datum.metrics.total_errors)", as: "errors"}
          {type: "formula", expr: "(datum.metrics == null ? 0 : datum.metrics.total_tx)", as: "tx"}
        ]
      },
      {
        name: links
        source: resources
        transform: [
          // find corresponding node from the right stack, keep it as "target"
          {
            type: lookup
            from: nodes
            key: name
